// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.18;

contract PaymentSystem {
    mapping(address => uint256) public balances;

    event PaymentSent(address indexed sender, address indexed recipient, uint256 amount);

    constructor() {
        address[3] memory accounts = [
            0x7E09Df1578bfD644db36f5Aad6F6D8434f891BA5, 
            0xFf072502C4cA940505F96f2D8b34798A77a22A26,
            0x2B991B6f15AeE6b909787FBEf096D4C0988C5CE9 
        ];

        uint256 initialBalance = 1000 ether;

        for (uint256 i = 0; i < accounts.length; i++) {
            balances[accounts[i]] = initialBalance;
        }
    }

    function sendPayment(address recipient, uint256 amount) external {
        require(amount > 0, "Amount must be greater than zero");
        require(balances[msg.sender] >= amount, "Insufficient balance");

        balances[msg.sender] -= amount;
        balances[recipient] += amount;

        emit PaymentSent(msg.sender, recipient, amount);
    }

    function getBalance(address account) external view returns (uint256) {
        return balances[account];
    }
}

